    false,nt"url": null,nt"notes": "In fall 2001, researchers from the Wells
    National Estuarine Research Reserve, Virginia Institute of Marine Science, and the
    NOAA Office for Coastal Management conducted a project to map benthic habitats in
    the York and Webhannet rivers in southern Maine. The team completed two weeks of
    fieldwork in September 2001, collecting sediment profile images at 382 stations
    and sediment grab samples at 93 stations. This data set represents the information
    gathered from sediment profile imagery sampling.",nt"license_title": null,nt"extras":
